import "./expenseList.css"

export const  ExpenseList= ()=>{
return (
    <div className="expsenseList-body">
        <h1>Expanse Tracker</h1>
        <div className="expenseList">
            <div className="expanselist-Container">
                <div className="expenseData">2010 july 11</div>
                <div className="expenseItem"> House Rent</div>
                <div className="expensePrice">$200</div>
            </div>

        </div>
    </div>
)
}
